import React from 'react';
import ReactDOM from 'react-dom';
import 'antd/dist/antd.css';

import { Modal, Button , Input, Form} from 'antd';

const { TextArea } = Input;

class App extends React.Component {

    constructor(props) {
		super(props)

		this.state = { nome: '', descricao: '' }

		this.handleSubmit = this.handleSubmit.bind(this)
		this.handleAreaDescricao = this.handleAreaDescricao.bind(this)
		this.handleAreaNome = this.handleAreaNome.bind(this)
  }
  state = { visible: false };

  showModal = () => {
    this.setState({
      visible: true,
    });
  };

  handleOk = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  handleCancel = e => {
    console.log(e);
    this.setState({
      visible: false,
    });
  };

  render() {
    const { getFieldDecorator } = this.props.form;
    return (
      <div>
        <Button type="primary" onClick={this.showModal}>
          Open Modal
        </Button>
        <Modal
          title="Basic Modal"
          visible={this.state.visible}
          onOk={this.handleOk}
          onCancel={this.handleCancel}
        >
          <Form labelCol={{ span: 5 }} wrapperCol={{ span: 12 }}>
            <Form.Item label="Nome">
              {getFieldDecorator('nome', {
                rules: [{ required: true, message: 'Por favor, insira um nome!' }],
              })(<Input type="text" name="nome" placeholder="Nome da Area de Atividade " allowClear />)}
            </Form.Item>
            <Form.Item label="Descrição">
              {getFieldDecorator('descrição', {
                rules: [{ required: true, message: 'Por favor, insira uma descrição!' }],
              })(<TextArea rows={4} type="text" name="descricao" placeholder="Descricao da Area de Atividade " allowClear />)}
            </Form.Item >
          </Form>
        </Modal>
      </div>
    );
  }
}


ReactDOM.render(<App />, document.getElementById('root'));
